					that.can.style.height = (img.height*((jQuery(window).width()/2*1)/img.width))+"px";
					
					ctx.fillStyle = '#fff'; 
					ctx.fillRect(0, 0, that.can.width, that.can.height);

					ctx.drawImage(img, 0, 0, that.can.width, that.can.height);

